import React from "react"; 

const educationContent = [
  {
    year: "2021",
    degree: "HIGH SCHOOL DIPLOMA",
    institute: "EXCEL HIGH SCHOOL",
  },
  {
    year: "2021",
    degree: "REAL ESTATE CORE",
    institute: "SANTA ROSA JUNIOR COLLEGE",
    details: `Mandatory for all those interested in testing for the California Bureau of Real Estate salespersons license.`,
  },
  {
    year: "2021",
    degree: "FULL-STACK SOFTWARE ENGINEER CERTIFICATION",
    institute: "CODING DOJO",
    details: `24wks, 35+hrs/wk, Full-Stack Python, Algorithms, Web Fundementals, Full-Stack M.E.R.N`,
    icon: require('/Users/zach/Downloads/themeforest-czKPbmTG-edina-personal-portfolio-react-template/edina/src/assets/excel.jpeg')
  },
];

const Education = () => {
  return (
    <ul>
      {educationContent.map((val, i) => (
        <li key={i}>
          <div className="icon">
            <img src={val.icon} alt="icon" />
          </div>
          <span className="time open-sans-font text-uppercase">{val.year}</span>
          <h5 className="poppins-font text-uppercase">
            {val.degree}
            <span className="place open-sans-font">{val.institute}</span>
          </h5>
          <p className="open-sans-font">{val.details}</p>
        </li>
      ))}
    </ul>
  );
};

export default Education;
